package com.Model;

public class DoanhNghiepHopTac {
	private int id;
	private String tenDoanhNghiep;
	private String tenGiamDoc;
	private String linhVuc;
	private String namHopTac;
	private String truSoChinh;
	private String soDienThoai;
	private String email;
	private String website;
	public DoanhNghiepHopTac() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getTenDoanhNghiep() {
		return tenDoanhNghiep;
	}
	public void setTenDoanhNghiep(String tenDoanhNghiep) {
		this.tenDoanhNghiep = tenDoanhNghiep;
	}
	public String getTenGiamDoc() {
		return tenGiamDoc;
	}
	public void setTenGiamDoc(String tenGiamDoc) {
		this.tenGiamDoc = tenGiamDoc;
	}
	public String getLinhVuc() {
		return linhVuc;
	}
	public void setLinhVuc(String linhVuc) {
		this.linhVuc = linhVuc;
	}
	public String getNamHopTac() {
		return namHopTac;
	}
	public void setNamHopTac(String namHopTac) {
		this.namHopTac = namHopTac;
	}
	public String getTruSoChinh() {
		return truSoChinh;
	}
	public void setTruSoChinh(String truSoChinh) {
		this.truSoChinh = truSoChinh;
	}
	public String getSoDienThoai() {
		return soDienThoai;
	}
	public void setSoDienThoai(String soDienThoai) {
		this.soDienThoai = soDienThoai;
	}
	public String getEmail() {
		return email;
	}
	public void setEmail(String email) {
		this.email = email;
	}
	public String getWebsite() {
		return website;
	}
	public void setWebsite(String website) {
		this.website = website;
	}
	
	

}
